A <a href="http://sw.opencyc.org/concept/Mx4rvViBApwpEbGdrcN5Y29ycA" class="cyc_term">BinaryPredicate</a> that relates a specialization of <a href="http://sw.opencyc.org/concept/Mx4rvVinb5wpEbGdrcN5Y29ycA" class="cyc_term">IntelligentAgent</a> to a specialization of <a href="http://sw.opencyc.org/concept/Mx4rvjSBSZwpEbGdrcN5Y29ycA" class="cyc_term">Artifact_Generic</a>.  <code>(<a href="http://sw.opencyc.org/concept/Mx4r2gAyptqIQdiSyYPRHDnAlA" class="cyc_term">agentTypeCreatesArtifactType</a> <b>AGT-TYPE</b> <b>ART-TYPE</b>)</code> means that instances of <code><b>AGT-TYPE</b></code> typically or frequently create instances of <code><b>ART-TYPE</b></code>.  For example:
<pre>
  (<a href="http://sw.opencyc.org/concept/Mx4r2gAyptqIQdiSyYPRHDnAlA" class="cyc_term">agentTypeCreatesArtifactType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjlpJwpEbGdrcN5Y29ycA" class="cyc_term">Baker</a> <font color="#ff0000">#$BakedFood</font>);
  (<a href="http://sw.opencyc.org/concept/Mx4r2gAyptqIQdiSyYPRHDnAlA" class="cyc_term">agentTypeCreatesArtifactType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjN-JwpEbGdrcN5Y29ycA" class="cyc_term">ComputerProgrammer</a> <a href="http://sw.opencyc.org/concept/Mx4rwJxiRJwpEbGdrcN5Y29ycA" class="cyc_term">ComputerProgram_CW</a>);
  (<a href="http://sw.opencyc.org/concept/Mx4r2gAyptqIQdiSyYPRHDnAlA" class="cyc_term">agentTypeCreatesArtifactType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVisSZwpEbGdrcN5Y29ycA" class="cyc_term">Painter_FineArtist</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjHfpwpEbGdrcN5Y29ycA" class="cyc_term">Painting_ArtForm</a>).
</pre>
